import { post } from '../../../../utils/axios'

export default class Record extends Component {
    getall = async()=>{
        try{
            let res = await post('/getall',{
                atoken:localStorage.getItem('data')
                })
                console.log(res)
        }catch(err){
            console.log("error",err)
    }
    }
    componentDidMount(){
        async
    }
    render() {
        return (
            <div>
                Record
            </div>
        )
    }
}
